package main

import (
	"fmt"
	// "math"
)

/*
test case:
"cbaebabacd", "abc"
	[0, 6]

	Input:
s: "abab" p: "ab"

Output:
[0, 1, 2]

Input
"ababababab"
"aab"
Output
[0,1,2,3,4,5,6,7]
Expected
[0,2,4,6]

""
""

*/
func main() {
	res := findAnagrams("cbaebabacd", "abc")
	fmt.Println(res)
}

func findAnagrams(s string, p string) []int {
	res := make([]int, 0)
	if len(s) == 0 || len(p) == 0 {
		return res
	}
	pl := len(p) - 1
	mp := make(map[byte]int, 0)
	for k := 0; k < len(p); k++ {
		if _, ok := mp[p[k]]; !ok {
			mp[p[k]] = 1
		} else {
			mp[p[k]]++
		}
	}
	for i := 0; i < len(s)-pl; i++ {
		sub := s[i:(i + pl + 1)]
		flag := true
		// fmt.Println(sub)
		ms := make(map[byte]int, 0)

		for j := 0; j < len(sub); j++ {
			if _, ok := ms[sub[j]]; !ok {
				ms[sub[j]] = 1
			} else {
				ms[sub[j]]++
			}
			if ms[sub[j]] > mp[sub[j]] {
				flag = false
				break
			}
		}

		if flag == true {
			for k, v := range ms {
				if mp[byte(k)] != v {
					flag = false
					break
				}
			}
		}

		if flag == true {
			for k, v := range mp {
				if ms[byte(k)] != v {
					flag = false
				}
			}
		}
		if flag == true {
			res = append(res, i)
		}
	}
	return res
}
